In this movie, I am very happy and proud to be the heroine for Life Without Cancer Society. 
When I needed to know that life goes on no matter what, I learned about the Life Without Cancer Society. I saw that they opened departments in hospitals for the treatment of thousands of them, provided psychological support to children and their families, and assisted hundreds of people become blood and stem cell donors.
All of these reminded me that by accepting the things I cannot change, I must use my power to change the things I can. We can all be heroes as much as we add value to the lives of others. I am starting this story by sending the first message to 4381 with the text KAHRAMAN (Hero) to remind that the families supported by the Life Without Cancer Society are our own... 
Those who want to donate from abroad can also give support from the link in the Bio of  Life @kansersizyasam Life Without Cancer Society.

... I know I am not alone... You can be someone's hero by sending a message to 4381.
